snippet.textDisplay:
Muito bem@Guilherme Alves, tem uma série de fatores há serem considerados aí:
 1 - as vacinas só começam a fazer efeito depois de DUAS SEMANAS após cada dose. Se você se contamina antes disso, de nada adianta;
2 - você não se vacinou e seus amigos sim, vocês deram sorte de sobreviver em ambos os casos sendo que seus amigos estavam bem mais protegidos. O vírus por sí só só mata 2% dos infectados, então no seu caso, não é surpresa, mas a questão é: qual seria o resultado se os seus amigos não tivessem se vacinado?
 Uma boa analogia é, se você vai junto com policiais para uma favela no meio de uma guerra de traficantes, os policiais vão preparados com colete à prova de balas e você vai sem essa proteção; pode dar sorte de todos vocês sobreviverem, isso não quer dizer que os policiais não estavam mais protegidos;
3 -  seus amigos podem ter tomado apenas uma dose;;
4 - seus amigos podem ter tomado as duas doses há muito tempo e os anti-corpos deles já decaíram o suficiente para ter sintomas e estão precisando tomar a terceira dose;
 5 - para encerrar, foi pura imprudência vocês terem saído para as festas de Ano Novo, independente de estarem vacinados ou não. No seu caso, você poderia ter tido complicações muito mais sérias. No caso deles, era previsível que iriam sobreviver, porém vocês todos transmitiram o vírus para  muita gente. Uma hora, um não-vacinado vai pagar o preço pelo que vocês fizeram.
E como eu já expliquei: vacina sozinha não resolve, tem que ter isolamento social e uso de máscara (máscara cirúrgica de preferência).

